import React, { useState, useEffect } from 'react';
import axios from 'axios';
import '../styles/Shopping.css';

const Shopping = () => {
  const [products, setProducts] = useState([]);
  const [filteredProducts, setFilteredProducts] = useState([]);
  const [error, setError] = useState('');
  const [category, setCategory] = useState('');

  useEffect(() => {
    const fetchProducts = async () => {
      try {
        const response = await axios.get('http://localhost:5000/api/products/all');
        setProducts(response.data);
        setFilteredProducts(response.data);
      } catch (error) {
        setError('Failed to fetch products');
      }
    };
    fetchProducts();
  }, []);

  const handleCategoryChange = (e) => {
    setCategory(e.target.value);
    if (e.target.value === '') {
      setFilteredProducts(products);
    } else {
      const filtered = products.filter((product) => product.category === e.target.value);
      setFilteredProducts(filtered);
    }
  };

  return (
    <div>
      <div className="shopping-navbar">
        <ul>
          <li>
            <a href="#fruits" onClick={() => handleCategoryChange({ target: { value: 'fruits' } })}>
              Fruits
            </a>
          </li>
          <li>
            <a href="#vegetables" onClick={() => handleCategoryChange({ target: { value: 'vegetables' } })}>
              Vegetables
            </a>
          </li>
          <li>
            <a href="#grains" onClick={() => handleCategoryChange({ target: { value: 'grains' } })}>
              Grains and Cereals
            </a>
          </li>
          <li>
            <a href="#pulses" onClick={() => handleCategoryChange({ target: { value: 'pulses' } })}>
              Pulses and Legumes
            </a>
          </li>
          <li>
            <a href="#spices" onClick={() => handleCategoryChange({ target: { value: 'spices' } })}>
              Spices and Herbs
            </a>
          </li>
          <li>
            <a href="#nuts" onClick={() => handleCategoryChange({ target: { value: 'nuts' } })}>
              Nuts and Seeds
            </a>
          </li>
          <li>
            <a href="#all" onClick={() => handleCategoryChange({ target: { value: '' } })}>
              All Products
            </a>
          </li>
        </ul>
      </div>
      <div className="product-sections">
        {filteredProducts.map((product) => (
          <div key={product._id} className="product-section">
            <div className="product-image">
              <img src={`http://localhost:5000/${product.imageUrl}`} alt={product.name} />
            </div>
            <div className="product-details">
              <h2>{product.name}</h2>
              <p>Quantity: {product.quantity} kg</p>
              <p>Price: â‚¹{product.price} per kg</p>
              <p>Category: {product.category}</p>
              <p>Farmer: {product.farmerName}</p>
              <button>Add to Cart</button>
            </div>
          </div>
        ))}
      </div>
      {error && <p>{error}</p>}
    </div>
  );
};

export default Shopping;
